INSERT INTO gz_app VALUES('3','3','1.0','分享按钮','share','0','0','5.0 Beta','6.jpg','2','/app/share/share.php','常常看到一些页面有分享按钮，此应用就可以设置分享按钮，或者自定义分享按钮代码。','0','0');
INSERT INTO gz_app VALUES('4','4','1.0','内容批量替换器','replace','0','0','5.0 Beta','8.jpg','0','','能够批量替换内容文字、超链接、图片路径，如公司地址、电话、某个链接地址变更，逐个修改效率太低，此应用是很好的解决办法。','0','0');
INSERT INTO gz_app VALUES('5','5','1.1','在线订购','shop','0','1','5.1.2','9.jpg','2-3-4','/app/shop/2.php-/app/shop/3.php-/app/shop/4.php','可以为产品内容页增加立即购买按钮并支持在线购买产品，有购物车功能和顺畅的购买流程，网站后台可以查看会员下的订单、财务流水，也可以根据需求设置在线订购的部分功能，目前只支持支付宝即时到帐接口且只支持中文（多语言在线订购功能后续升级包会推出）。','0','0');
INSERT INTO gz_app VALUES('6','6','1.0','站内广告','advs','0','1','5.1.6','advs.png','2','/app/advs/advs.php','目前支持三种广告方式：对联广告、通栏广告（页面顶部展开后隐藏或悬浮页面中间）、右下角广告（支持自定义HTML）。能够将广告投放在指定栏目页面中，可以设置广告开始日期和结束日期（结束后不再展示），可以设置广告在页面出现后展示时长（超过时间自动消失）等。','1368489600','1368489600');
INSERT INTO gz_app VALUES('7','7','1.0','robots在线修改器','robots','0','0','5.0 Beta','robots.png','','','网站通过robots协议告诉搜索引擎哪些页面可以抓取，哪些页面不能抓取。此工具用来在线修改robots。','0','0');
