INSERT INTO gz_app VALUES('9','9','1.01','微信公众号管理系统','weixin','0','0','5.2.3','weixin.jpg','1','/app/weixin/is_weixin.php','自定义菜单、微官网、智能回复...移动网络营销必备！企业网络营销不仅仅是在电脑上，手机市场更需要争夺。','1395044072','1395044072');
