INSERT INTO gz_column VALUES('318','公司简介','','About','','314','0','1','0','0','0','0','0','','广西润垦农业科技有限公司是一家集蔬菜、花卉、水果的种植与销售；农业技术的研究、开发；项目投资及管理；货物及技术进出口；园林绿化工程、地基与基础工程、土石方工程...  ... ','<p>广西润垦农业发展有限公司（简称润垦农业），成立于2005年，是集资产管理、资本运作、产业投资和生产经营于一体的民营企业集团，旗下农业金融与信息技术服务板块——上海大生农业金融科技股份有限公司在香港联交所主板上市主营业务包括农业产业投资、种业研发与运营、农产品全球采购和智慧流通、产业链金融、农业科技研究与应用、农业土地生态修复与治理、农资和农技服务及智慧城市投资运营等。</p><p>代表着遵循宇宙的自然规律（大道），生生不息、周而复始地发展农业。大生农业集团以&quot;合耕力、取精华、利益众食&quot;为企业核心价值理念，坚持以人为本，以&quot;良&quot;为念，奉献大众，回报社会。以&quot;归属感、荣誉感、成就感&quot;作为全体大生人追求的精神，在努力为社会、为民众创造价值中实现企业和个人的发展进步。</p><p><img src=\"http://rk.com/upload/201705/1494466115131565.jpg\" title=\"1494466115131565.jpg\" alt=\"4.jpg\"/></p>','广西润垦农业发展有限公司（简称润垦农业），成立于2005年，是集资产管理、资本运作、产业投资和生产经营于一体的民营企业集团，旗下农业金融与信息技术服务板块——上海大生农业金融科技股份有限公司在香港联交所主板上市主营业务包括农业产业投资、种业研发与运营、农产品全球采购和智慧流通、产业链金融、农业科技研究与应用、农业土地生态修复与治理、农资和农技服务及智慧城市投资运营等。代表着遵循宇宙的自然规律（大道','1','','2','','0','0','','/upload/201705/1494466745.jpg','1','cn','','0','0','1','0','0');
