INSERT INTO gz_news VALUES('208','公司新闻2','','大生农业集团党委、工会到公司所在地福田区福山社区开展帮扶活动，将一批慰问品送到社区困','最新公告2覅的地方地方军阀的看法','<p>大生农业全面打造线上线下农产品全球采购交易平台：在线下，通过托管、并购和新建农批市场及冷链物流交易中心，运用先进运营理念、云平台技术和创新金融工具，将其建成集标准化、系统化、信息化、智能化和金融化为一体的新型智慧农产品物流交易中心；同时，以农产品流通渠道和交易大数据为基础，统筹国际、国内两大市场，建立大生农产品质量标准，聚合全球优质、特色农产品，打造专业化高品质交易平台，构建全球农产品采购体系。</p>','140','192','0','0','0','0','/upload/201705/1494483792.jpg','/upload/201705/1494483792.jpg','0','admin','22','2017-05-11 16:31:35','2017-05-11 16:32:05','0','0','','cn','0','1','','','','','','','');
INSERT INTO gz_news VALUES('209','公司新闻3','','大生农业集团党委、工会到公司所在地福田区福山社区开展帮扶活动，将一批慰问品送到社区困','最新公告3好地方还是对方的南极科考就','<p>作为中国领先的农产品智慧流通运营商，大生农业全面打造线上线下农产品全球采购交易平台：在线下，通过托管、并购和新建农批市场及冷链物流交易中心，运用先进运营理念、云平台技术和创新金融工具，将其建成集标准化、系统化、信息化、智能化和金融化为一体的新型智慧农产品物流交易中心；同时，以农产品流通渠道和交易大数据为基础，统筹国际、国内两大市场，建立大生农产品质量标准，聚合全球优质、特色农产品，打造专业化高品质交易平台，构建全球农产品采购体系。</p><p>集团以国企、央企和实力民企略合作方，发起设立多层次、多结构的农业产业基金，培育发展、芥花油、苹果、燕麦、茶叶、杂粮、杂豆等优质农产品产业项目；积极整合供港及各地品牌农产品和全球优质资源，建设高标准产业基地；推动农产品冷链物流和智慧农批市场项目整合。通过设立融资租赁、商业保理、农业保险公司、小贷公司等多类型金融服务机构，参股商业银行，依据大数据信息和物流监管，积极开展融资租赁、商业保理、保险代理、互联网金融、小额贷款等农业产业链金融综合服务，提升农业金融覆盖率，为从业者提供资金保障，为产业发展注入动力和支持，实现产业经济与金融资本的有效融合和协同发展。与相关机构定期举办&quot;中国金融改革论坛&quot;，推动中国金融领域的改革创新，为金融服务提供理论引领。</p><p><img src=\"http://rk.com/upload/201705/1494413452108801.jpg\" title=\"1494413452108801.jpg\" alt=\"6.jpg\"/></p>','140','192','0','0','0','0','/upload/201705/1494483660.jpg','/upload/201705/thumb/1494483660.jpg','0','admin','24','2017-05-11 14:18:30','2017-05-11 14:18:46','0','0','','cn','0','1','','','','','','','');
INSERT INTO gz_news VALUES('237','公司简介标题','','广西润垦农业科技有限公司是一家集蔬菜、花卉、水果的种植与销售；农业技术的研究、开发；项目投资及管理；货物及技术进出口；园林绿化工程、地基与基础工程、土石方工程...  ...','广西润垦农业发展有限公司（简称润垦农业），成立于2005年，是集资产管理、资本运作、产业投资和生产经营于一体的民营企业集团，旗下农业金融与信息技术服务板块——上海大生农业金融科技股份有限公司在香港联交所主板上市主营业务包括农业产业投资、种业研发与运营、农产品全球采购和智慧流通、产业链金融、农业科技研究与应用、农业土地生态修复与治理、农资和农技服务及智慧城市投资运营等。代表着遵循宇宙的自然规律（大道','<p><span style=\"color: rgb(101, 101, 101); font-family: Arial, \" microsoft=\"\">广西润垦农业发展有限公司（简称润垦农业），成立于2005年，是集资产管理、资本运作、产业投资和生产经营于一体的民营企业集团，旗下农业金融与信息技术服务板块——上海大生农业金融科技股份有限公司在香港联交所主板上市主营业务包括农业产业投资、种业研发与运营、农产品全球采购和智慧流通、产业链金融、农业科技研究与应用、农业土地生态修复与治理、农资和农技服务及智慧城市投资运营等。</span></p><p><br/></p><p><span style=\"color: rgb(101, 101, 101); font-family: Arial, \" microsoft=\"\">代表着遵循宇宙的自然规律（大道），生生不息、周而复始地发展农业。大生农业集团以&quot;合耕力、取精华、利益众食&quot;为企业核心价值理念，坚持以人为本，以&quot;良&quot;为念，奉献大众，回报社会。以&quot;归属感、荣誉感、成就感&quot;作为全体大生人追求的精神，在努力为社会、为民众创造价值中实现企业和个人的发展进步。</span></p><p><img src=\"http://rk.com/upload/201705/1494409401323599.jpg\" title=\"1494409401323599.jpg\" alt=\"4.jpg\"/></p>','306','307','0','0','0','0','/upload/201705/1494409305.jpg','/upload/201705/1494409305.jpg','0','admin','0','2017-05-10 17:51:47','2017-05-10 17:51:53','0','0','','cn','0','1','','','','','','','');
